  const [isLogged, setIsLogged] = useState(false);

  // const checkLogged = () => {
  //   setIsLogged(!isLogged);
  // };

  return (
    <>
      {isLogged ? (
        <>
          <Dashboard setIsLogged={setIsLogged} />
        </>
      ) : (
        <LandPage setIslogged={setIsLogged} />
      )}
    </>
  );
};

export default App;
